                    <p className= "font-bold">
                     {title}</p>
                       <p className= "font-light">
                      {PersonName}</p> 
                </div>

                <p className= "font-bold  text-gray-500">
                {Time}</p>
            </div>

        </div>
        </div>

    )
}

